import styled from 'styled-components'

export const HomeWrapper = styled.div`
    width: 80%;
    margin: 100px  auto;
    padding: 56px;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 12px 7px;
    border-radius: 10px;
`;

export const PageCardFlexWrapper = styled.div`
    display: flex;
    justify-content: space-between;
`;
